window.bookSummaryJSON = "<p>Liam and his childhood best friend Rebecca were raised in a small town. Now living in the city, as roommates, they encounter more challenges than the average college student. <br> &nbsp;</p> <p>When faced with the reality of having to quit school and move back home, Liam and Rebecca get an odd invitation to move into a mansion with a group of extremely wealthy guys from the college. Liam knows it’s all too good to be true, but he gives into Rebecca’s pleas to take the offer until they get back on their feet. <br> &nbsp;</p> <p>Weeks turn into months, and as Liam discovers the truth of what happens within those walls and Rebecca finds herself in the middle of a dangerous game between lust and envy, their lives quickly spiral out of control.</p>"; 
